package week1.day2;

public class RelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int n1=10;
		int n2=20;
		
		if (n1==n2)
       System.out.println("n1=n2");
		
		if (n1!=n2)
			System.out.println("n1 not equal to n2");
		
		if (n1>n2)
			System.out.println("n1>n2");
		
		if(n1<n2)
			System.out.println("n1<n2");
		
	}

}
